import React, { useState } from 'react';
import {  Button } from 'react-bootstrap';
import Modal from 'react-modal';
import "../Modals/icashStyle.css"

function IcashModal() {
	const [IcashIsOpen, setIcashIsOpen] = useState(false);
	return (
		<div className="conoCe">
			<Button className="conoceBtn" onClick={() => setIcashIsOpen(true)}>Conoce Más ✚</Button>

			<div className="iCashWrapper">
				<Modal className="modalFrame" isOpen={IcashIsOpen} onRequestClose={() => setIcashIsOpen(false)}>
					<div className="Clooosebtn">
						<Button className="closeBtn" onClick={() => setIcashIsOpen(false)}>
							X
						</Button>
					</div>
					<h1 className="saveMeTitleMod">
						SAVE ME BUTTON <br /> HAS BEEN ACTIVATED!!!
					</h1>

					<div className="etextsaveMeWrap">
						<p className="saveMeEText">
							We just alert EVERYONE
							<br />
							in our power please keep <br />
							safe sister, we are in our way there!
						</p>
					</div>
				</Modal>
			</div>
		</div>
	);
}

export default IcashModal;
